1. Zapewniamy, że naszym nadrzędnym celem jest zapewnienie użytkownikom aplikacji ochrony prywatności.
2. Możemy zbierać, przechowywać i używać następujących danych osobowych:
 * Informacje o twoim urządzeniu i użyciu aplikacji (łącznie z twoim adresem IP, lokalizacją, typem i wersją przeglądarki, systemem operacyjnym, domeną, czasem spędzonym na stronie i ścieżkami nawigacyjnymi);
 * Informacje podane przez ciebie przy rejestracji;
 * Twój adres email i imię użyte przy tworzeniu profilu;
 * Informacje podane przez ciebie przy tworzeniu profilu psa w naszej aplikacji;
 * Informacje zawarte w lub powiązane z jakąkolwiek komunikacją, którą wysyłasz do nas lub za pośrednictwem naszej aplikacji (w tym treści oraz metadane powiązane z komunikacją);
 * jakiekolwiek inne dane osobowe, które zdecydujesz się nam wysłać.
3. Używanie Dogo przez osoby nieletnie
 Aby zarejestrować się jako użytkownik, musisz mieć ukończone 18 lat lub osiągnąć wiek pełnoletniości w swoim regionie lub państwie. Osoby nieletnie mogą używać produktu wyłącznie za zgodą rodzica lub opiekuna prawnego, na rachunek tej osoby, postępując zgodnie z tymi Warunkami.
4. Zanim wyjawisz nam dane osobowe innej osoby, musisz uzyskać jej zgodę na ujawnienie i przetwarzanie tych danych zgodnie z tą polityką prywatności.
5. Możemy użyć twoich danych osobowych, aby:
 * Spersonalizować naszą platformę;
 * Wysyłać ci powiadomienia mailowe, jeśli będziesz chciał;
 * Wysyłać ci mailem biuletyn, jeśli będziesz chciał (możesz poinformować nas w każdej chwili, jeśli nie będziesz chciał go otrzymywać);
 * Wysyłać komunikaty marketingowe dotyczące naszych interesów (lub interesów starannie wybranych stron trzecich), które naszym zdaniem, mogą być dla ciebie interesujące, publikując je jako komentarz lub, jeśli wyraziłeś na to zgodę, zawierając w mailu bądź wiadomości w podobnych komunikatorach (możesz poinformować nas w każdej chwili, jeśli nie będziesz już chciał ich otrzymywać);
 * Dostarczyć stronom trzecim statystyk o naszych użytkownikach (strony trzecie nie będą w stanie zidentyfikować z tych informacji indywidualnych użytkowników);
 * Zajmować się związanymi z naszą aplikacją pytaniami i skargami złożonymi przez ciebie lub na ciebie;
 * Zapewnić bezpieczeństwo naszej aplikacji i zapobiegać oszustwom.
6. Nie przekażemy twoich danych osobowych stronom trzecim w celach marketingu bezpośredniego ich lub innych stron trzecich, bez twojej wyraźnej zgody.
7. Dane osobowe, które przetwarzamy w jakimkolwiek celu lub celach, nie będą przechowywane dłużej niż to potrzebne dla tego celu lub celów.
8. Uploadowane pliki
 * Jesteś właścicielem treści i masz zgodę wszystkich stron, które się w niej pojawiają;
 * Egzaminy wideo są przechowywane na naszych serwerach, abyś mógł przeglądać je w historii. Nie udostępniamy egzaminów wideo do celów marketingowych, a także nie udostępniamy ich stronom trzecim lub innym użytkownikom;
 * Zastrzegamy sobie prawo do udostępniania plików, które przesyłasz do wyzwań, w celach reklamowych, marketingowych;
 * Na twoją prośbę zawsze usuniemy lub edytujemy twoje treści wysłane do nas.
9. Zachowamy dokumenty (także dokumenty elektroniczne) zawierające dane osobowe:
 * Do stopnia, do którego jesteśmy zobowiązani przez prawo;
 * Jeśli uważamy, że te dokumenty mogą być związane z trwającym lub przyszłym postępowaniem prawnym;
 * W celu ustanawiania, wykonywania i obrony naszych praw (w tym zapewnianie informacji innym w celu zapobiegania wyłudzeniom i zmniejszenia ryzyka kredytowego).
10. Podejmiemy odpowiednie, techniczne i organizacyjne, środki ostrożności, aby zapobiec utracie, niewłaściwemu użyciu lub modyfikacji twoich danych osobowych.
11. Przechowujemy przekazane przez ciebie twoje dane osobowe na bezpiecznych (zabezpieczonych hasłem i firewallem) serwerach.
12. Przyjmujesz do wiadomości, że przesył informacji przez internet jest z natury niepewny i nie możemy zagwarantować bezpieczeństwa danych wysyłanych przez internet.
13. Jesteś odpowiedzialny za utrzymanie w tajemnicy hasła używanego przez ciebie do logowania w naszej aplikacji; nigdy nie poprosimy cię o twoje hasło (oprócz momentu, w którym logujesz się do naszej aplikacji).
